L1 = sorted(list(map(int, input().split())))
L2 = sorted(list(map(int, input().split())))
i = j = 0
same = 0
while(i<len(L1) and j<len(L2)):
	if i>0:
		if L1[i] == L1[i-1]:
			i+=1
    if j>0:
		if L2[j] == L2[j-1]:
			j+=1
    if L1[i]<L2[j]:
        i+=1
    elif L2[j]<L1[i]:
        j+=1
    elif L1[i]==L2[j]:
        same+=1
        i+=1
        j+=1
different = len(L1)+len(L2)-same*2
print("same:"+str(same))
print("different:"+str(different))

